import React, { Component } from 'react'
import {MDBRow, MDBCol, MDBNavbar, MDB} from 'mdbreact'
import LogoConviasa from "./img/logo.svg"
import BanderaV from "./img/venezuela.png"

class index extends Component {
  // stepper
  state = {
    formActivePanel1: 1,
    formActivePanel1Changed: false,
  }

  swapFormActive = (a) => (param) => (e) => {
    this.setState({
      ['formActivePanel' + a]: param,
      ['formActivePanel' + a + 'Changed']: true
    });
  }

  handleNextPrevClick = (a) => (param) => (e) => {
    this.setState({
      ['formActivePanel' + a]: param,
      ['formActivePanel' + a + 'Changed']: true
    });
  }

  handleSubmission = () => {
    alert('Form submitted!');
  }

  calculateAutofocus = (a) => {
    if (this.state['formActivePanel' + a + 'Changed']) {
      return true
    }
  }
  // fin stepper
  render() {
    return (
      <div>
        <MDBNavbar fixed="top " className="colorConviasa">
          <MDBCol md="2" className="text-center yellow">
            <img src={LogoConviasa} alt="logo" />
          </MDBCol>
          <MDBCol md="7" className="green">
          <MDBStepper icon>
            <MDBStep far icon="folder-open" stepName="Basic Information" onClick={this.swapFormActive(1)(1)}></MDBStep>
            <MDBStep icon="pencil-alt" stepName="Personal Data" onClick={this.swapFormActive(1)(2)}></MDBStep>
            <MDBStep icon="photo" stepName="Terms and Conditions" onClick={this.swapFormActive(1)(3)}></MDBStep>
            <MDBStep icon="check" stepName="Finish" onClick={this.swapFormActive(1)(4)}></MDBStep>
          </MDBStepper>
          </MDBCol>
          <MDBCol md="2" className="red">
            <MDBRow>
              <MDBCol size="1">
                <img src={BanderaV} alt="Contacto"/>
              </MDBCol>
              <MDBCol>
              <p className="white-text">05002668427</p>
              </MDBCol>
            </MDBRow>
          </MDBCol>
        </MDBNavbar>
      </div>
    )
  }
}

export default index
